CREATE TABLE `visitas` (
  `Id` int NOT NULL AUTO_INCREMENT,
  `paciente` int NOT NULL,
  `medico` int NOT NULL,
  `fecha` datetime NOT NULL,
  `informe` text,
  PRIMARY KEY (`Id`),
  KEY `medico_fk_idx` (`medico`),
  KEY `paciente_fk_idx` (`paciente`),
  CONSTRAINT `medico_fk` FOREIGN KEY (`medico`) REFERENCES `medicos` (`Id`) ON DELETE RESTRICT ON UPDATE CASCADE,
  CONSTRAINT `paciente_fk` FOREIGN KEY (`paciente`) REFERENCES `pacientes` (`Id`) ON UPDATE CASCADE
